  true,\n\t\"url\": null,\n\t\"notes\": \"DOT's electronic Learning Management System
  (eLMS) is a state-of-the-art web-based system that meets the needs of training administrators,
  learners, and managers and facilitates fulfilling the requirements of the e-Gov
  Act of 2002. It is the official system of records for DOT employees' training. eLMS
  provides online courses, instructor-led-training, and capabilities for Individual
  Development Plans (IDP's) and competency management.\",\n\t\"license_title\": \"Other
